# `U` is a predefined unit of measure that means 19.05mm, which is MX spacing
units:
  diode_x: 8.25
  diode_y: 0
  diode_rotate: 90
  mx: 14
  mx_keycap: 18
  mcu_margin: U
  outline_fillet: 10
  outline_margin: u/2
  plate_expand: 0
  # editable
  tangent_angle: -15
  screw_size: 2.2
  tangent_distance: 3
  tab_circle_edge_thickness: 2
  foot_radius: 1
  # editable

  tangent_distance_formula: screw_size + tangent_distance
  tab_circle_formula: screw_size + tab_circle_edge_thickness
  tab_circle_cutout_formula: screw_size

points:
  key:
    footprints:
      switch:
        type: mx
        nets:
          from: =colrow
          to: =column_net
        params:
          reverse: true
          keycaps: true
      diode:
        type: diode
        anchor:
          shift: [diode_x, diode_y]
          rotate: diode_rotate
        nets:
          from: =colrow
          to: =row_net
        params:
          via_in_pad: true
  zones:
    matrix:
      columns:
        outer:
          key:
            column_net: P16
          rows:
            bottom:
              footprints:
                switch:
                  anchor:
                    rotate: 180
                rotary:
                  type: rotary
                  anchor:
                    - ref: matrix_outer_home
                      shift: [0, -1U]
                      rotate: 90
                  nets:
                    from: =column_net
                    to: =colrow
                    A: P1
                    B: P0
                    C: GND
        pinky:
          key:
            column_net: P14
        ring:
          key:
            stagger: 0.6U
            column_net: P15
        middle:
          key:
            stagger: 0.15U
            column_net: P18
        index:
          key:
            stagger: -0.25U
            column_net: P19
        inner:
          key:
            stagger: -0.15U
            column_net: P20
        extra:
          rows:
            bottom:
              skip: true
          key:
            stagger: -0.5u
            column_net: P21
            footprints:
              diode:
                anchor:
                  shift: [-diode_x, diode_y]
      rows:
        bottom:
          row_net: P8
          padding: U

        home:
          row_net: P7
          padding: U
        top:
          row_net: P6
          padding: U
        number:
          row_net: P5
          padding: U

    thumb_cluster:
      anchor:
        ref: matrix_inner_bottom
        shift: [-2U, -U]
      rows:
        mods:
          row_net: P9
      columns:
        mod_one:
          key:
            column_net: P15
        mod_two:
          key:
            column_net: P18
        near:
          key:
            spread: U + 2
            stagger: -2
            splay: -10
            column_net: P19
        home:
          key:
            rotate: 90
            width: 1.25u
            shift: [0, 0.25U-2]
            tags:
              125u: true
              1u: false
            column_net: P20
        far:
          key:
            rotate: -90
            width: 1.25u
            shift: [0, 0.25U - 2]
            tags:
              125u: true
              1u: false
            column_net: P21
            footprints:
              diode:
                anchor:
                  shift: [-diode_x, diode_y]
outlines:
  _switches:
    - what: rectangle
      where: true
      size: mx
      bound: false
  _keycaps:
    - what: rectangle
      size: mx_keycap
      where: true
      bound: false
  _plate_tab:
    - operation: stack
      what: polygon
      points:
        - shift: [0, 0]
        - shift: [0, foot_radius]
        - shift: [foot_radius, 0]
          orient: tangent_angle
        - shift: [tangent_distance_formula, 0]
          orient: 90
        - shift: [tab_circle_formula, 0]
          orient: -90
        - shift: [tab_circle_formula, 0]
          orient: -tangent_angle*2
        - shift: [tangent_distance_formula, 0]
          orient: -90
        - shift: [foot_radius, 0]
          orient: 90
        - shift: [foot_radius, 0]
          orient: tangent_angle - 90
      adjust:
        - shift: [0, foot_radius]
        - shift: [-foot_radius, 0]
          orient: tangent_angle
        - shift: [-tangent_distance_formula, 0]
          orient: 90
        - shift: [-tab_circle_formula, 0]
          orient: -90
        - shift: [0, 0]
          orient: -tangent_angle
        - ref: matrix_outer_bottom
          affect: y
    - operation: subtract
      what: circle
      radius: foot_radius
      where:
        shift: [0, foot_radius]
      adjust:
        - shift: [0, foot_radius]
        - shift: [tab_circle_formula, 0]
          orient: -tangent_angle
        - shift: [tangent_distance_formula, 0]
          orient: -90
        - shift: [-foot_radius, 0]
          orient: -90
        - ref: matrix_outer_bottom
          affect: y
    - operation: subtract
      what: circle
      radius: foot_radius
      where:
        shift: [0, foot_radius]
      adjust:
        - shift: [0, foot_radius]
        - shift: [-tab_circle_formula, 0]
          orient: tangent_angle
        - shift: [tangent_distance_formula, 0]
          orient: -90
        - shift: [-foot_radius, 0]
          orient: 90
        - ref: matrix_outer_bottom
          affect: y
    - operation: add
      what: circle
      radius: tab_circle_formula
      adjust:
        - shift: [0, foot_radius]
        - shift: [-tab_circle_formula, 0]
          orient: tangent_angle
        - shift: [tangent_distance_formula, 0]
          orient: -90
        - shift: [-foot_radius, 0]
          orient: 90
        - ref: matrix_outer_bottom
          affect: y
        - shift: [0, foot_radius]
          orient: -tangent_angle
        - shift: [foot_radius, 0]
          orient: tangent_angle
        - shift: [tangent_distance_formula, 0]
          orient: 90
        - shift: [tab_circle_formula, 0]
          orient: -90
    - operation: subtract
      what: circle
      radius: tab_circle_cutout_formula
      adjust:
        - shift: [0, foot_radius]
        - shift: [-tab_circle_formula, 0]
          orient: tangent_angle
        - shift: [tangent_distance_formula, 0]
          orient: -90
        - shift: [-foot_radius, 0]
          orient: 90
        - ref: matrix_outer_bottom
          affect: y
        - shift: [0, foot_radius]
          orient: -tangent_angle
        - shift: [foot_radius, 0]
          orient: tangent_angle
        - shift: [tangent_distance_formula, 0]
          orient: 90
        - shift: [tab_circle_formula, 0]
          orient: -90
  _base_outline:
    - what: polygon
      points:
        - ref: matrix_outer_bottom
          shift: [-outline_margin, -outline_margin]
        - ref: matrix_outer_number
          # 0.001 fixes the DRC in kicad with out affecting the outline
          shift: [-outline_margin, outline_margin-0.001]
        - ref: matrix_middle_number
          shift: [-outline_margin - U, outline_margin]
        - ref: matrix_middle_number
          shift: [outline_margin + 1.5U, outline_margin]
        - ref: matrix_extra_number
          shift: [0, outline_margin]
        - ref: matrix_extra_number
          shift: [outline_margin+mcu_margin, outline_margin]
        - ref: matrix_extra_home
          shift: [outline_margin+mcu_margin, 0]
        - ref: thumb_cluster_far_mods
          shift: [-outline_margin, outline_margin]
        - ref: thumb_cluster_far_mods
          shift: [outline_margin + 0.15U, outline_margin]
        - ref: thumb_cluster_home_mods
          shift: [-outline_margin- 0.15u, outline_margin]
        - ref: thumb_cluster_mod_two_mods
          shift: [outline_margin, -outline_margin]
        - ref: thumb_cluster_mod_one_mods
          shift: [-outline_margin, -outline_margin]
        - ref: matrix_pinky_bottom
          shift: [outline_margin, -outline_margin]

  _panel:
    - what: outline
      name: _base_outline
      fillet: 2
  _fillet_panel:
    - what: outline
      name: _panel
      fillet: outline_fillet
  _plate_base:
    - what: outline
      name: _fillet_panel
      expand: plate_expand
  preview:
    - what: outline
      name: _plate_base
      operation: add
      expand: 10
    - what: outline
      name: _switches
      operation: subtract

  plate:
    - what: outline
      name: _plate_base
      operation: add
    - name: _plate_tab
      operation: add
      where: matrix_pinky_bottom
      adjust:
        shift: [-U/2, -outline_margin - plate_expand]
        rotate: 180
    - name: _plate_tab
      operation: add
      where: matrix_outer_number
      adjust:
        shift: [-outline_margin - plate_expand, 0]
        rotate: 90
    - name: _plate_tab
      operation: add
      where: matrix_outer_bottom
      adjust:
        shift: [-outline_margin - plate_expand, 0]
        rotate: 90
    - name: _plate_tab
      operation: add
      where: thumb_cluster_mod_one_mods
      adjust:
        shift: [outline_margin + plate_expand, -outline_margin - plate_expand]
        rotate: 180
    - name: _plate_tab
      operation: add
      where: thumb_cluster_near_mods
      adjust:
        shift: [U*1.5, -outline_margin - plate_expand]
        rotate: 180
    - name: _plate_tab
      operation: add
      where: thumb_cluster_far_mods
      adjust:
        shift: [-0, outline_margin + plate_expand]
        rotate: 0
    - name: _plate_tab
      operation: add
      where: matrix_extra_number
      adjust:
        shift: [outline_margin+mcu_margin, 0]
        rotate: -90
    - name: _plate_tab
      operation: add
      where: matrix_middle_number
      adjust:
        shift: [-U-2.45, outline_margin+plate_expand]
        rotate: 0
    - name: _plate_tab
      operation: add
      where: matrix_middle_number
      adjust:
        shift: [U*1.5+2.45, outline_margin+plate_expand]
        rotate: 0
    - what: outline
      name: _switches
      operation: subtract

pcbs:
  spleeb:
    outlines:
      main:
        outline: _panel
    footprints:
      promicro:
        type: promicro-reverse
        anchor:
          - ref: matrix_extra_number
            shift: [(U + mcu_margin) / 2, -6]
            rotate: -90
      oled:
        type: oled-reversable
        anchor:
          - ref: matrix_extra_number
            shift: [(U + mcu_margin) / 2 - 6, -28]
            rotate: 90
        nets:
          SDA: P2
          SCL: P3
      rst_tactile:
        type: button
        params:
          side: B
          variant: 4_pin_th_side
        anchor:
          - ref: matrix_extra_home
            shift: [U + (outline_margin / 2 + 1), 0]
            rotate: -88
        nets:
          from: GND
          to: RST
      trrs:
        type: trrs
        nets:
          A: GND
          B: GND
          C: P4
          D: VCC
        anchor:
          ref: thumb_cluster_far_mods
          shift: [-U, outline_margin / 2 + 2]
          rotate: 17.75
        params:
          reverse: true
          symmetric: true
